import React, {Component} from 'react';

import logo from './img/logo.png';
import maintittle from './img/maintittle.png';
import './css/viewFeedback.css';
import FeedbackTableRow from './feedbackTableRow';



class viewFeedback extends Component{

    constructor(props) {
        super(props);
        this.state = {feedback : []};
    }

    componentDidMount() {
        // alert('email is ' +this.props.match.params.id);
        axios.get('http://localhost:4000/trainFoodAdmin/admindeliver/'+this.props.match.params.id)
            .then(response => {
                // alert('Pass una')
                // alert('Data Tika :'+response.data)
                this.setState({delivers : response.data});

            })
            .catch(function (error){
                console.log(error);
            })
    }

    tabRow(){
        return this.state.delivers.map(function (object, i){
            return <DeliverTableRow obj = {object} key = {i}/>;
        });
        // return <OrderTableRow obj={this.state.orders}/>
    }
  render() {
    return(
        <div>
                
            <div className='top-nav'>
                <div className='logo'>
                    <img src = {logo}/>
                </div>
                <div className='nav-item'>
                     <ul>
                        <li>
                            <a href = "">Home</a>
                        </li>
                        <li>
                            <a href = "">Offers</a>
                        </li>
                        <li>
                            <a href = "/addFeedback">About Us</a>
                        </li>
                        <li>
                            <a href = "">Contact Us</a>
                        </li>
                     </ul>
                </div>
                <div className='sign-in'>
                     <button>Sign In</button>
                </div>
            </div>

            <div className='main-tittle'>
                <img src ={maintittle} />
            </div>


        </div>
    );
  }
}

export default viewFeedback;
